import { Link } from "react-router-dom";

export default function Header() {
    return (
      <header>
        <Link to="/"><a href="" className="logo">MyBlog</a></Link>
        <nav>
          <Link to="/login">Login</Link>
          <Link to="/register">Register</Link>
        </nav>
      </header>
    );
}
